import React from 'react';

const TableComponentDetails = (props) => {
  const { tableData } = props;

  return (
    <div className='details-table'>
      <h2>Details</h2>
      <table>
        <thead>
          <tr>
            <th>Column 1</th>
            <th>Column 2</th>
          </tr>
        </thead>
        <tbody>
          {tableData.map((row, index) => (
            <tr key={index}>
              <td>{row.column1}</td>
              <td>{row.column2}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default TableComponentDetails;
